import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./OneOnOneSessions.css";

const OneOnOneSessions = () => {
  const navigate = useNavigate();
  const [selectedSession, setSelectedSession] = useState(null);

  const counselors = [
    { id: 1, name: "Dr. Jane Smith", specialization: "Anxiety", price: 50 },
    { id: 2, name: "Dr. Robert Johnson", specialization: "Depression", price: 60 },
    { id: 3, name: "Dr. Emily Davis", specialization: "Stress Management", price: 55 },
    { id: 4, name: "Dr. Michael Brown", specialization: "Trauma", price: 70 },
    { id: 5, name: "Dr. Sarah Wilson", specialization: "Self-Esteem", price: 50 },
  ];

  const handleBookNow = (session) => {
    setSelectedSession(session);
    alert(`You selected a session with ${session.name}. Proceeding to payment...`);
  };

  const handleProceedToPayment = () => {
    if (!selectedSession) return;

    // Razorpay Payment Integration
    const options = {
      key: "YOUR_RAZORPAY_KEY", // Replace with your Razorpay Key
      amount: selectedSession.price * 100, // Amount in paise (multiply by 100)
      currency: "INR",
      name: "SMHS",
      description: `Payment for ${selectedSession.specialization} session`,
      image: "https://your-logo-link.com/logo.png", // Optional logo URL
      handler: (response) => {
        alert("Payment Successful!");
        console.log("Payment Response:", response);
        // Add logic to save payment details or booking confirmation
      },
      prefill: {
        name: "John Doe", // Prefilled user name
        email: "johndoe@example.com", // Prefilled user email
        contact: "9999999999", // Prefilled user contact
      },
      theme: {
        color: "#007bff", // Branding color
      },
    };

    const razorpay = new window.Razorpay(options);
    razorpay.open();
  };

  return (
    <div className="one-on-one-container">
      {/* Navbar */}
      <nav className="navbar">
        <h2 className="brand-name">SMHS</h2>
        <ul className="nav-links">
          <li>
            <button onClick={() => navigate("/home")} className="nav-link">Home</button>
          </li>
          <li>
            <button onClick={() => navigate("/one-on-one-sessions")} className="nav-link">One-on-One Sessions</button>
          </li>
          <li>
            <button onClick={() => navigate("/virtual-sessions")} className="nav-link">Virtual Sessions</button>
          </li>
          <li>
            <button onClick={() => navigate("/about-us")} className="nav-link">About Us</button>
          </li>
        </ul>
      </nav>

      {/* Main Section */}
      <header className="one-on-one-header">
        <h1>One-on-One Sessions</h1>
        <p>Choose a counselor for a personalized session</p>
      </header>
      <div className="counselors-grid">
        {counselors.map((counselor) => (
          <div className="counselor-card" key={counselor.id}>
            <h3>{counselor.name}</h3>
            <p>Specialization: {counselor.specialization}</p>
            <p>Price: ₹{counselor.price}/session</p>
            <button
              className="book-now-button"
              onClick={() => handleBookNow(counselor)}
            >
              Book Now
            </button>
          </div>
        ))}
      </div>
      {selectedSession && (
        <div className="payment-container">
          <h3>Proceed to Payment for {selectedSession.name}</h3>
          <p>Specialization: {selectedSession.specialization}</p>
          <p>Price: ₹{selectedSession.price}</p>
          <button className="proceed-button" onClick={handleProceedToPayment}>
            Proceed to Payment
          </button>
        </div>
      )}
    </div>
  );
};

export default OneOnOneSessions;
